lash-scaled.jpg\",\"id\":503,\"alt\":\"\",\"source\":\"library\"}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"b715bca\",\"elType\":\"section\",\"settings\":{\"height\":\"min-height\"},\"elements\":[{\"id\":\"80e8837\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"ce867a1\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h3>Express Delivery<\\/h3><p>Next-day delivery is available for all\\u00a0 (Excluding Highlands &amp; Islands) that are placed before 4pm. Orders placed after the cut-off time on any working day will be processed and dispatched on the following working day.<\\/p><p>Any Next Day Weekday orders placed on Friday before 4pm will arrive the following Monday. Please note any orders placed over the weekend with the Next Day Service will be processed on Monday with the parcel out for delivery on Tuesday.<\\/p><p>If you require Weekend Delivery- please select the Saturday or Sunday option.<\\/p><p>\\u00a0Where an order is time-critical, we ask that you ensure you place your order in good time to avoid disappointment.<\\/p><h3>Free Delivery<\\/h3><p>This offer:<\\/p><p>\\u00a0<\\/p><ul><li>Only applies to standard delivery<\\/li><li>Only applies to basket totals of\\u00a0<strong>\\u00a390 (inc VAT)<\\/strong>\\u00a0or more<\\/li><li>Is not valid for next-day or weekend delivery<\\/li><li>Will automatically be applied at the checkout<\\/li><\\/ul><h3>Collect In Store<\\/h3><p>Not currently available due to building works.<\\/p><h3>International Delivery*<\\/h3><p>*<strong>PLEASE NOTE:<\\/strong> Currently, we are \\u00a0shiping outside the internationally at a low rate.<\\/p><p>\\u00a0<\\/p><h3>Punctuality of Service<\\/h3><p>Please note that we are unable to guarantee the punctuality of service provided by our delivery agents, particularly during spells of difficult weather conditions. If your shipment is delivered unacceptably late after having been collected from us on time by our agent, we will try to secure a refund where appropriate.<\\/p><h3>Damaged Parcels<\\/h3><p>We take pride in packing your order to ensure that it arrives in perfect condition. Unfortunately, there are times when parcels incur damage while in transit. If a parcel shows clear signs of damage or leakage at the time of delivery, we ask that you refuse the parcel. Please ask the courier to return the goods to sender.<\\/p>\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Quicksand\",\"typography_font_size\":{\"unit\":\"px\",\"size\":17,\"sizes\":[]},\"typography_font_weight\":\"400\",\"typography_line_height\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"align\":\"center\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),(4112,45,'_elementor_page_assets','a:0:{}'),(4137,41,'_wp_page_template','default'),(4188,41,'_elementor_edit_mode','builder'),(4189,41,'_elementor_template_type','wp-page'),(4190,41,'_elementor_version','3.6.5'),(4191,41,'_astra_content_layout_flag','disabled'),(4192,41,'site-post-title','disabled'),(4193,41,'ast-title-bar-display','disabled'),(4194,41,'ast-featured-img','disabled'),(4195,41,'site-content-layout','page-builder'),(4196,41,'site-sidebar-layout','no-sidebar'),(4205,41,'_elementor_data','[{\"id\":\"c6ae7f6\",\"elType\":\"section\",\"settings\":{\"height\":\"min-height\"},\"elements\":[{\"id\":\"6036c45\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"f5aecf5\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<header class=\\\"entry-header\\\"><h1 class=\\\"entry-title\\\">Returns and Refunds<\\/h1><\\/header><div class=\\\"entry-content\\\"><p>At House of Malt\\u00a0we\\u00a0strive\\u00a0to\\u00a0provide\\u00a0100% customer satisfaction and\\u00a0we\\u00a0want\\u00a0to make sure\\u00a0that you\\u00a0are completely\\u00a0happy\\u00a0with your\\u00a0order.<\\/p><p>\\u00a0If you are not happy with your order, we will organise a refund and arrange a return or exchange of the products, provided that you inform us of your intention to return the products within 14 days from the date of your order being delivered.<\\/p><p>\\u00a0However, please note\\u00a0we\\u00a0will only\\u00a0reimburse\\u00a0the\\u00a0cost\\u00a0of\\u00a0returning\\u00a0items\\u00a0where they were\\u00a0delivered\\u00a0in\\u00a0error\\u00a0or the\\u00a0items\\u00a0were damaged or defective.\\u00a0In order to be eligible for a full refund, the following details would have to be complied with:<\\/p><p>1. Cancellation to be in writing.<br \\/>2. The goods must not be damaged or soiled in any way.<br \\/>3. Goods if possible to be in their original packaging.<br \\/>4. The cost of returning the goods would be at your expense.<br \\/>5. The goods must arrive back undamaged. Please consider insuring the goods before despatch.<br \\/>6. A full refund cannot be given for damaged or soiled goods.<br \\/>7. Customised items or orders cannot be returned.<br \\/>8. Purchased Software with the seal broken can not be returned under the distance selling regulations.<br \\/>9. Variations to these conditions may apply \\u2013 subject to mutual agreement.<br \\/>10. Bottling\\u2019s which are under the rare or exclusive category cannot be returned unless prior agreement is made.<\\/p><p>For order cancellations the products ordered must be returned to us in good condition and in the original packaging. All refunds will be paid within 14 days of receiving the returned product(s).<\\/p><p>Should a mistake be made in shipping, or a product arrives with damage or a manufacturing defect, we will replace the product and may request the product is returned to us. We can either arrange a collection of the damaged item or refund the cost of the returns postage up to a total of \\u00a35.00<\\/p><p>These conditions only apply to UK sales.<\\/p><p>FAO RETURNS<br \\/>House of Malt<br \\/>48 Warwick Road<br \\/>Carlisle<br \\/>CA1 1DN<\\/p><p>Please contact us if you need further help or assistance.<\\/p><\\/div>\",\"text_color\":\"#7A7A7A\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Quicksand\",\"typography_font_size\":{\"unit\":\"px\",\"size\":16,\"sizes\":[]},\"typography_font_weight\":\"400\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),(4211,41,'_elementor_page_assets','a:0:{}'),(5033,43,'_wp_page_template','default'),(5038,335,'_wp_page_template','default'),(5046,335,'_thumbnail_id','336'),(5047,335,'ast-featured-img','disabled'),(5255,673,'_wp_attached_file','2022/06/FR_Quad_black13.jpg'),(5256,673,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1254;s:6:\"height\";i:1000;s:4:\"file\";s:27:\"2022/06/FR_Quad_black13.jpg\";s:8:\"filesize\";i:182892;s:5:\"sizes\";a:14:{s:21:\"woocommerce_thumbnail\";a:6:{s:4:\"file\";s:27:\"FR_Quad_black13-420x420.jpg\";s:5:\"width\";i:420;s:6:\"height\";i:420;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:48720;s:9:\"uncropped\";b:0;}s:29:\"woocommerce_gallery_thumbnail\";a:5:{s:4:\"file\";s:27:\"FR_Quad_black13-100x100.jpg\";s:5:\"width\";i:100;s:6:\"height\";i:100;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:21143;}s:18:\"woocommerce_single\";a:5:{s:4:\"file\";s:27:\"FR_Quad_black13-800x638.jpg\";s:5:\"width\";i:800;s:6:\"height\";i:638;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:90337;}s:6:\"medium\";a:5:{s:4:\"file\";s:27:\"FR_Quad_black13-300x239.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:239;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:32562;}s:5:\"large\";a:5:{s:4:\"file\";s:28:\"FR_Quad_black13-1024x817.jpg\";s:5:\"width\";i:1024;s:6:\"height\";i:817;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:127896;}s:9:\"thumbnail\";a:5:{s:4:\"file\";s:27:\"FR_Quad_black13-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:23732;}s:12:\"medium_large\";a:5:{s:4:\"fi