INSERT INTO `wp_posts` VALUES (2,1,'2022-05-27 01:33:34','2022-05-27 01:33:34','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wordpress%205/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','HOME','','draft','closed','closed','','sample-page','','','2022-05-27 21:49:29','2022-05-27 21:49:29','',0,'http://localhost/wordpress%205/?page_id=2',0,'page','',0),(3,1,'2022-05-27 01:33:34','2022-05-27 01:33:34','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost/wordpress%205.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2022-05-27 01:33:34','2022-05-27 01:33:34','',0,'http://localhost/wordpress%205/?page_id=3',0,'page','',0),(5,1,'2022-05-27 01:47:33','2022-05-27 01:47:33','','Default Kit','','publish','closed','closed','','default-kit','','','2022-08-10 23:46:37','2022-08-10 23:46:37','',0,'http://localhost/wordpress%205/?p=5',0,'elementor_library','',0),(6,1,'2022-05-27 01:52:08','2022-05-27 01:52:08','<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h6>AVALAIBLE WHILE STOCK LAST</h6>		\n		<h3><strong>Acquire rare &amp; exclusive taste at ware house sale</strong></h3><h6><strong>In recent years Japanese Whisky has pushed the boundaries of the whisky world, including winning Whisky of the Year awards. You will consistently find one, or many Japanese whiskies in influential Top Ten whisky lists. Whisky from Japan is a giant in its own right, with the likes of Yamazaki, Hibiki, Nikka, Taketsuru and many others now offering complex and innovative flavours. Try a bottle and see for yourself.</strong></h6><h2>House of Bourbon blog</h2><h4>Interviews with industry legends, cocktail recipes, competitions and more, all on our very</h4><h4>own blog!</h4>		\n			<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"683\" height=\"1024\" src=\"https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-683x1024.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-683x1024.jpg 683w, https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-scaled-800x1199.jpg 800w, https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-200x300.jpg 200w, https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-768x1151.jpg 768w, https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-1025x1536.jpg 1025w, https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-1366x2048.jpg 1366w, https://whiskylandmart.com/wp-content/uploads/2022/05/august-phlieger-fcyqGNfNJQk-unsplash-scaled.jpg 1708w\" sizes=\"(max-width: 683px) 100vw, 683px\" />															\n		<h6></h6><h6>We also offer a range of cask services as independent bottlers. We can help you sell your cask of Scotch Whisky and advise you on bottling your cask under our independent label.</h6>		\n															<img width=\"683\" height=\"1024\" src=\"https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-683x1024.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-683x1024.jpg 683w, https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-scaled-800x1200.jpg 800w, https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-200x300.jpg 200w, https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-768x1152.jpg 768w, https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-1024x1536.jpg 1024w, https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-1365x2048.jpg 1365w, https://whiskylandmart.com/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-scaled.jpg 1707w\" sizes=\"(max-width: 683px) 100vw, 683px\" />															\n		<h6></h6><h6>We also offer a range of cask services as independent bottlers. We can help you sell your cask of Scotch Whisky and advise you on bottling your cask under our independent label.</h6>		\n															<img width=\"683\" height=\"1024\" src=\"https://whiskylandmart.com/wp-content/uploads/2022/05/dusan-jovic-NHMUvu58Iz8-unsplash-683x1024.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://whiskylandmart.com/wp-content/uploads/2022/05/dusan-jovic-NHMUvu58Iz8-unsplash-683x1024.jpg 683w, https://whiskylandmart.com/wp-content/uploads/2022/05/dusan-jovic-NHMUvu58Iz8-unsplash-scaled-800x1200.jpg 800w, https://whiskylandmart.com/wp-content/uploads/2022/05/dusan-jovic-NHMUvu58Iz8-unsplash-200x300.jpg 200w, https://whiskylandmart.com/wp-content/uploads/2022/05/