					\n															 Mark Sommers\n																						Designer\n			<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-widget-image-carousel .swiper-container{position:static}.elementor-widget-image-carousel .swiper-container .swiper-slide figure{line-height:inherit}.elementor-widget-image-carousel .swiper-slide{text-align:center}.elementor-image-carousel-wrapper:not(.swiper-container-initialized) .swiper-slide{max-width:calc(100% / var(--e-image-carousel-slides-to-show, 3))}</style>		\n								<figure><img src=\"https://whiskylandmart.com/wp-content/uploads/2022/08/hos_homepage_desktop_header_carousel_tsukuriwake.jpg\" alt=\"hos_homepage_desktop_header_carousel_tsukuriwake\" /></figure><figure><img src=\"https://whiskylandmart.com/wp-content/uploads/2022/08/sw_homepage_desktop_header_carousel7_hakushu_0.png\" alt=\"sw_homepage_desktop_header_carousel7_hakushu_0\" /></figure><figure><img src=\"https://whiskylandmart.com/wp-content/uploads/2022/08/sw_homepage_desktop_header_carousel5_philosophy_0.png\" alt=\"sw_homepage_desktop_header_carousel5_philosophy_0\" /></figure><figure><img src=\"https://whiskylandmart.com/wp-content/uploads/2022/08/1-1.jpg\" alt=\"1\" /></figure>			\n												Previous\n												Next\n		<section id=\"Panel1\"><section><p>Since our founders Rajbir and Sukhinder Singh shipped their first orders back in 1999, our business grew from a two-man operation to the worlds leading retailer of premium spirits.</p></section></section><section id=\"Panel2\"><header></header></section><section id=\"Panel2\"><section><p>From the day the Whisky Exchange came online, weve sought to build a global community thats as passionate about quality drinks as we are. We believe in sharing our collective knowledge, encouraging exploration, and championing producers were passionate about. Whether youre visiting our website, attending our events, or shopping in one of our bricks-and-mortar locations, well always find the best bottles for you.</p></section></section><section id=\"Panel3\"><header></header></section><section id=\"Panel2\"><section><section id=\"Panel2\"><section><p>From the day the Whisky Exchange came online, weve sought to build a global community thats as passionate about quality drinks as we are. We believe in sharing our collective knowledge, encouraging exploration, and championing producers were passionate about. Whether youre visiting our website, attending our events, or shopping in one of our bricks-and-mortar locations, well always find the best bottles for you.</p></section></section><section id=\"Panel3\"><header></header></section></section></section><section id=\"Panel3\"><header></header></section><section id=\"Panel3\"><section><p>Were a team of enthusiasts and theres nothing we love more than sharing a glass of something good. Our search for new flavours has led us all over the world, where weve found treasures in the unknown, the overlooked and the underrated. The range we offer is neatly curated yet diverse with a continuously-evolving selection of old &amp; rare spirits, exclusive bottlings and new releases.</p></section></section><section id=\"Panel4\"><header></header></section><section><section><section id=\"Panel4\"><section><p>Anyone whos ever filled a cask or laid down a bottle knows that the drinks business is all about planning for tomorrow. As we go forward, we want to grow the community weve built in our first two decades and continue to improve our customer experience. Weve always been early adopters and we will continue to expand our charitable efforts and our commitment to sustainability. Theres always a new spirit to discover, a new producer to get to know, or a new cocktail to make and we look forward to sharing them all with you.</p></section></section><footer id=\"footer\" role=\"contentinfo\"></footer></section></section><footer id=\"footer\" role=\"contentinfo\"></footer>','ABOUT US','','publish','closed','closed','','about-us','','','2022-08-10 21:51:11','2022-08-10 21:51:11','',0,'http://localhost/wordpress%205/?page_id=35',0,'page','',0),(36,1,'2022-05-27 21:57:51','2022-05-27 21:57:51','{\"version\": 2, \"isGlobalStylesUserThemeJSON\": true }','Custom Styles','','publish','closed','closed','','wp-global-styles-astra','','','2022-05-27 21:57:51','2022-05-27 21:57:51','',0,'http://localhost/wordpress%205/?p=36',0,'wp_global_styles','',0),(39,1,'2022-05-27 22:00:11','2022-05-27 22:00:11','','EXCLUSIVE & RARE','','publish','closed','closed','','exclusive-rare','','','2022-05-27 22:00:15','2022-05-27 22:00:15','',0,'http://localhost/wordpress%205/?page_id=39',0,'page','',0),(41,1,'2022-05-27 22:03:57','2022-05-27 22:03:57','<header><h1>Returns and Refunds</h1></header><p>At House of Maltwestrivetoprovide100% customer satisfaction andwewantto make surethat youare completelyhappywith yourorder.</p><p>If you are not happy with your order, we will organise a refund and arrange a return or exchange of the products, provided that you inform us of your intention to return the products within 14 days from the date of your order being delivered.</p><p>However, please notewewill onlyreimbursethecostofreturningitemswhere they weredeliveredinerroror theitemswere damaged or defective.In order to be eligible for a full refund, the following details would have to be complied with:</p><p>1. Cancellation to be in writing.<br />2. The goods must not be damaged or soiled in any way.<br />3. Goods if possible to be in their original packaging.<br />4. The cost of returning the goods would be at your expense.<br />5. The goods must arrive back undamaged. Please consider insuring the goods before despatch.<br />6. A full refund cannot be given for damaged or soiled goods.<br />7. Customised items or orders cannot be returned.<br />8. Purchased Software with the seal broken can not be returned under the distance selling regulations.<br />9. Variations to these conditions may apply  subject to mutual agreement.<br />10. Bottlings which are under the rare or exclusive category cannot be returned unless prior agreement is made.</p><p>For order cancellations the products ordered must be returned to us in good condition and in the original packaging. All refunds will be paid within 14 days of receiving the returned product(s).</p><p>Should a mistake be made in shipping, or a product arrives with damage or a manufacturing defect, we will replace the product and may request the product is returned to us. We can either arrange a collection of the damaged item or refund the cost of the returns postage up to a total of 5.00</p><p>These conditions only apply to UK sales.</p><p>FAO RETURNS<br />House of Malt<br />48 Warwick Road<br />Carlisle<br />CA1 1DN</p><p>Please contact us if you need further help or assistance.</p>','RETURNS','','publish','closed','closed','','returns-2','','','2022-06-10 01:53:17','2022-06-10 01:53:17','',0,'http://localhost/wordpress%205/?page_id=41',0,'page','',0),(43,1,'2022-05-27 22:04:44','2022-05-27 22:04:44','','BLOG','','publish','closed','closed','','blog','','','2022-05-30 04:19:12','2022-05-30 04:19:12','',0,'http://localhost/wordpress%205/?page_id=43',0,'page','',0),(45,1,'2022-05-27 22:06:09','2022-05-27 22:06:09','<h1>Delivery</h1><p>All orders are shipped in our specialist glass packaging with full tracking to your door  using reputable and secure international couriers. A tracking email is provided when your order is dispatched. We ship whiskies worldwide using fast delivery partners. Orders are shipped directly from our depot to your door Monday-Friday excluding local holidays. Delivery insurance is included within the delivery fee, you can order safe in the knowledge your parcel is fully protected.</p>		\n			<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"683\" height=\"1024\" src=\"http://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-683x1024.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-683x1024.jpg 683w, https://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-scaled-800x1200.jpg 800w, https://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-200x300.jpg 200w, https://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-768x1152.jpg 768w, https://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-1024x1536.jpg 1024w, https://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-1365x2048.jpg 1365w, https://bourbunwhiskies.shop/wp-content/uploads/2022/05/victor-hughes-VGb-g8eaRxI-unsplash-scaled.jpg 1707w\" sizes=\"(max-width: 683px) 100vw, 683px\" />															\n		<h3>Express Delivery</h3><p>Next-day delivery is available for all (Excluding Highlands &amp; Islands) that are placed before 4pm. Orders placed after the cut-off time on any working day will be processed and dispatched on the following working day.</p><p>Any Next Day Weekday orders placed on Friday before 4pm will arrive the following Monday. Please note any orders placed over the weekend with the Next Day Service will be processed on Monday with the parcel out for delivery on Tuesday.</p><p>If you require Weekend Delivery- please select the Saturday or Sunday option.</p><p>Where an order is time-critical, we ask that you ensure you place your order in good time to avoid disappointment.</p><h3>Free Delivery</h3><p>This offer:</p><p></p><ul><li>Only applies to standard delivery</li><li>Only applies to basket totals of<strong>90 (inc VAT)</strong>or more</li><li>Is not valid for next-day or weekend delivery</li><li>Will automatically be applied at the checkout</li></ul><h3>Collect In Store</h3><p>Not currently available due to building works.</p><h3>International Delivery*</h3><p>*<strong>PLEASE NOTE:</strong> Currently, we are shiping outside the internationally at a low rate.</p><p></p><h3>Punctuality of Service</h3><p>Please note that we are unable to guarantee the punctuality of service provided by our delivery agents, particularly during spells of difficult weather conditions. If your shipment is delivered unacceptably late after having been collected from us on time by our agent, we will try to secure a refund where appropriate.</p><h3>Damaged Parcels</h3><p>We take pride in packing your order to ensure that it arrives in perfect condition. Unfortunately, there are times when parcels incur damage while in transit. If a parcel shows clear signs of damage or leakage at the time of delivery, we ask that you refuse the parcel. Please ask the courier to return the goods to sender.</p>','DELIVERY','','publish','closed','closed','','delivery','','','2022-06-10 01:55:52','2022-06-10 01:55:52','',0,'http://localhost/wordpress%205/?page_id=45',0,'page','',0),(47,1,'2022-05-27 22:07:02','2022-05-27 22:07:02','<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h3>Testimonials</h3>		\n			<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-testimonial-wrapper{overflow:hidden;text-align:center}.elementor-t