g in the bourbon collection. I love your stuff. Whenever I wanna try something new I go here every time. Its stuck on me haha\n							<img width=\"80\" height=\"80\" src=\"http://bourbunwhiskies.shop/wp-content/uploads/2022/05/wedding-event-caterer-customer-review-2.jpg\" alt=\"\" loading=\"lazy\" />						\n														 Bill Edward\n							Owner was fantastic, and super helpful in working with me to select some local spirits. Prices were really reasonable too! Ill be sure to come back here next time Im in the area.\n							<img width=\"80\" height=\"80\" src=\"http://bourbunwhiskies.shop/wp-content/uploads/2022/05/event-catering-service-reviews-6.jpg\" alt=\"\" loading=\"lazy\" />						\n														Mia Sophia\n							Classic fast delivery service you guys got here. I ordered from Denver and it took only 2 hours and I got my package. boy was I high lol, got hungover all night.\n							<img width=\"250\" height=\"250\" src=\"http://bourbunwhiskies.shop/wp-content/uploads/2022/05/member3.jpg\" alt=\"\" loading=\"lazy\" />						\n														Julia Miles\n							Truly one of the best service a customer can receive! Gennaro knows his spirits!!!! Not only he expanded my world of scotch whiskey, but the world of red wine (primarily Malbecs) and cider.\n							<img width=\"80\" height=\"80\" src=\"http://bourbunwhiskies.shop/wp-content/uploads/2022/05/wedding-event-caterer-customer-review-3.jpg\" alt=\"\" loading=\"lazy\" />						\n														Amy White\n							This place is the best! The people who work here are true experts on everything they sell. Great if youre looking for something new or even locally made. They also host tasting events often, their cider tasting event last month was fun and informative!!! Never tried so many different types of hard cider in my life!\n							<img width=\"80\" height=\"80\" src=\"http://bourbunwhiskies.shop/wp-content/uploads/2022/05/event-catering-service-reviews-5.jpg\" alt=\"\" loading=\"lazy\" />						\n														Jeremy 