ault\"} -->\n<figure class=\"wp-block-image size-full is-style-default\"><img src=\"http://localhost/wordpress%205/wp-content/uploads/2022/05/Diageo-2020-Special-Releases-1024x576-1.jpeg\" alt=\"\" class=\"wp-image-336\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">The Diageo annual collection explores unusual age points, experimental maturation techniques</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Created by Diageo master blender Dr. Craig Wilson, the whiskies tend to be experiments in flavor, bringing out unusual profiles that are not often associated with the distillery the whiskies are sourced from.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This year, we welcome to the line-up the first ever release finished in pot-still Caribbean rum casks.&nbsp;Like the 2019 releases the Rare by Nature theme highlights the extraordinary nature that surrounds each distillery.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below are 4 of these special releases, comprising of 8 in total.<br><br>Sign up for the stock-alerts for when these rare whiskies arrive into stock:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://localhost/wordpress%205/?page_id=43\">http://localhost/wordpress%205/?page_id=43</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Mortlach 21 Year Old 2020 Special Release</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":339,\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-style-default\"><img src=\"http://localhost/wordpress%205/wp-content/uploads/2022/05/sr_lifestyle-mortlach-min-1024x683.jpg\" alt=\"\" class=\"wp-image-339\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The Talisker 8 Year Old 2020 Special Release</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":340,\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-style-default\"><img src=\"http://localhost/wordpress%205/wp-content/uploads/2022/05/sr_lifestyle-talisker-min-1024x683.jpg\" alt=\"\" class=\"wp-image-340\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The Cardhu 11 Year Old 2020 Special Release</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":341,\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-style-default\"><img src=\"http://localhost/wordpress%205/wp-content/uploads/2022/05/sr_lifestyle-cardhu-min-1024x683.jpg\" alt=\"\" class=\"wp-image-341\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The Singleton of Dufftown 17 Year Old 2020 Special Release</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":342,\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-style-default\"><img src=\"http://localhost/wordpress%205/wp-content/uploads/2022/05/sr_lifestyle-singleton-min-1024x683.jpg\" alt=\"\" class=\"wp-image-342\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Posted on&nbsp;<time datetime=\"2020-04-17T12:43:45+01:00\">17th April 2020</time>&nbsp;by&nbsp;Ben Turnbull&nbsp;&nbsp;Leave a comment</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>A moments release from Port Ellen  a 40 year old 9 Rogue Casks.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":343,\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-style-default\"><img src=\"http://localhost/wordpress%205/wp-content/uploads/2022/05/PE40-2-1024x628.jpg\" alt=\"\" class=\"wp-image-343\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Port Ellen 40 Year Old 9 Rogue Casks</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>What do we know about this iconic distillery? Port Ellen hugs the coastline on the revered isle of Islay off the west coast of Scotland, this distillery has achieved legendary status amongst connoisseurs in the know with whiskies that are among the most sought after, with the magic and mystique growing with age since the distillerys closure in 1983. Plans are now in place and work has started on rebuilding a brand new distillery to re-open in 2021.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The stocks from Port Ellen before closure in 1983 are limited in quantity and highly revered by the whisky experts as they improve with age. Special releases of these stocks offer a unique opportunity to own a part of Port Ellens history. There are only 1380 bottles available of the 9 Rogue Casks release which makes it both the oldest and the most limited public release from the distillery.<br><br>Here at House of Malt towers, we do love a good Port Ellen, and being the oldest ever release from this iconic distillery we are very excited to try this one, aged whisky being better is something that is not always the case  however Port Ellen ages incredibly well, and we think that this will be the best Port Ellen yet. Not a cheap bottle by any stretch, but enthusiasts and collectors will be fighting for this one.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>House of Bourbon are taking pre-orders on this special release now, link below:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>What do we know about this iconic distillery? Port Ellen hugs the coastline on the revered isle of Islay off the west coast of Scotland, this distillery has achieved legendary status amongst connoisseurs in the know with whiskies that are among the most sought after, with the magic and mystique growing with age since the distillerys closure in 1983. Plans are now in place and work has started on rebuilding a brand new distillery to re-open in 2021.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The stocks from Port Ellen before closure in 1983 are limited in quantity and highly revered by the whisky experts as they improve with age. Special releases of these stocks offer a unique opportunity to own a part of Port Ellens history. There are only 1380 bottles available of the 9 Rogue Casks release which makes it both the oldest and the most limited public release from the distillery.<br><br>Here at House of Malt towers, we do love a good Port Ellen, and being the oldest ever release from this iconic distillery we are very excited to try this one, aged whisky being better is something that is not always the case  however Port Ellen ages incredibly well, and we think that this will be the best Port Ellen yet. Not a cheap bottle by any stretch, but enthusiasts and collectors will be fighting for this one.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>House of Malt are taking pre-orders on this special release now, link below:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tasting notes from Port Ellen are:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nose: Delicate, grassy/herbal, burnt tangerine skin, very mild smoke at cask strength, opens up a little with the addition of water, crme caramel/roasted coffee, red fruit compote, ripe peach skin.<br><br>Palate: Much more pronounced bonfire smoke, pipe tobacco, leather, wood spice.<br><br>Finish: Long, wispy smoke finish.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Category:&nbsp;Uncategorised</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tags:&nbsp;Port Ellen 40 9 Casks,&nbsp;Port Ellen 40 Year Old 9 Rogue Casks Whisky,&nbsp;Port Ellen 9 Rogue Casks,&nbsp;Port Ellen Rogue,&nbsp;Port Ellen Whisky</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Posted on&nbsp;<time datetime=\"2019-11-18T11:55:41+00:00\">18th November 2019</time>&nbsp;by&nbsp;Andy Butcher&nbsp;&nbsp;Leave a comment</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Whisky is good for you</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Its open season for influenza and us mere mortals are easy pickings! We know this time of year well. We sit anxiously at our desks, playing Russian roulette with our colleagues as to who will be struck down with Sue from accountings lurgy next!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For once, science has brought us some good tidings that proves its not all doom and gloom. Whisky my friends, is good for you! It is your ally in this winter war against the sniffles. For the cure-less common cold whisky may in fact lessen the symptoms. Were looking at you Hot Toddy! HT, the classic winter warmer of whisky, honey, lemon and hot water that your great Aunt swears by! Where the hot water lessens nasal congestion, the alcohol itself dilates the blood vessels allowing your mucus membranes to fight off the infection! &nbsp;WOAH!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It got us thinkingwhy stop at a hot toddy? We may not be drs here at HOB but we do know our whiskies so using the principles listed above, here are our suggestions to ease your seasonal ailments!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><strong>Arran Gold Latte</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":344,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-full is-style-default\"><img src=\"http://localhost/wordpress%205/wp-content/uploads/2022/05/Scotch-Coffee-Cocktail-Recipe-Liquorary-OSBP-21-416x520-1.jpg\" alt=\"\" class=\"wp-image-344\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Cream liqueur and steamed milk meld seamlessly together with dark, rich espresso cutting through the sweetness.&nbsp; The caffeine in the coffee also has pain killing properties that will directly target a head cold and clear the fog a little.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>50ml Arran Gold</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>1 shot of espresso</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>200ml steamed milk</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:embed {\"url\":\"http://localhost/wordpress%205/?product_cat=rare-exclusive\",\"type\":\"wp-embed\",\"providerNameSlug\":\"house-of-bourbon\"} -->\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-house-of-bourbon wp-block-embed-house-of-bourbon\"><div class=\"wp-block-embed__wrapper\">\nhttp://localhost/wordpress%205/?product_cat=rare-exclusive\n</div></figure>\n<!-- /wp:embed -->','BLOG','','publish','open','open','','blog','','','2022-05-30 04:34:22','2022-05-30 04:34:22','',0,'http://localhost/wordpress%205/?p=335',0,'post','',0),(336,1,'2022-05-28 18:27:06','2022-05-28 18:27:06','','Diageo-2020-Special-Releases-1024x576-1','','inherit','open','closed','','diageo-2020-special-releases-1024x576-1','','','2022-05-28 18:27:06','2022-05-28 18:27:06','',335,'http://localhost/wordpress%205/wp-content/uploads/2022/05/Diageo-2020-Special-Releases-1024x576-1.jpeg',0,'attachment','image/jpeg',0),(339,1,'2022-05-28 22:15:48','2022-05-28 22:15:48','','sr_lifestyle-mortlach-min','','inherit','open','closed','','sr_lifestyle-mortlach-min','','','2022-05-28 22:15:48','2022-05-28 22:15:48','',335,'http://localhost/wordpress%205/wp-content/uploads/2022/05/sr_lifestyle-mortlach-min.jpg',0,'attachment','image/jpeg',0),(340,1,'2022-05-28 22:19:44','2022-05-28 22:19:44','','sr_lifestyle-talisker-min','','inherit','open','closed','','sr_lifestyle-talisker-min','','','2022-05-28 22:19:44','2022-05-28 22:19:44','',335,'http://localhost/wordpress%205/wp-content/uploads/2022/05/sr_lifestyle-talisker-min.jpg',0,'attachment','image/jpeg',0),(341,1,'2022-05-28 22:20:27','2022-05-28 22:20:27','','sr_lifestyle-c