&#038;p=868',0,'product','',0),(869,1,'2022-08-10 11:10:37','2022-08-10 11:10:37','','Hibiki-30-Year-Old-Limited-Edition','','inherit','open','closed','','hibiki-30-year-old-limited-edition','','','2022-08-10 11:10:37','2022-08-10 11:10:37','',868,'https://whiskylandmart.com/wp-content/uploads/2022/08/Hibiki-30-Year-Old-Limited-Edition.jpg',0,'attachment','image/jpeg',0),(870,1,'2022-08-10 11:11:05','2022-08-10 11:11:05','The Kacho Fugetsu Hibiki 30 Year Old is the very top of the Hibiki range and part of their appreciation of the beauty of Japanese nature. The special limited release was exclusive to Travel Retail in 2015.\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">This is the oldest Kacho Fugetsu of the Hibiki. Collect also the 12, 17 and 21 years old Kacho Fugetsu as well!</div>\r\n<div dir=\"auto\">Hibiki 30 year old is the cream of crop. It was awarded the Trophy at the International Spirits Challenge in 2004,2006 and 2008.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">And the coveted title Worlds Best Blended Whisky at the World Whiskies Award 2007 and 2008.</div>\r\n<div dir=\"auto\">Only 100 bottles ever released of this awesome whisky and decanter!</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">See also the other versions of the Hibiki 30 we all have in stock:</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Hibiki 30 Regular</div>\r\n<div dir=\"auto\">Hibiki 30 Aritayaki</div>\r\n<div dir=\"auto\">Hibiki 30 Gold</div>','Hibiki 30 Years The Beauty of Japan Limited edition','<div dir=\"auto\"><strong>Bottle size :</strong>700 ml</div>\r\n<div dir=\"auto\"><strong>Bottle strength :</strong>43%</div>\r\n<div dir=\"auto\"><strong>Distillery :</strong>Hibiki</div>\r\n<div dir=\"auto\"><strong>Region :</strong>Asian</div>\r\n<div dir=\"auto\"><strong>Whisky :</strong>Blend</div>\r\n&nbsp;','publish','open','closed','','hibiki-30-years-the-beauty-of-japan-limited-edition','','','2022-08-10 11:12:34','2022-08-10 11:12:34','',0,'https://whiskylandmart.com/?post_type=product&#038;p=870',0,'product','',0),(871,1,'2022-08-10 11:12:25','2022-08-10 11:12:25','','2016-12-22-01.32.04-768x768-2-300x300','','inherit','open','closed','','2016-12-22-01-32-04-768x768-2-300x300','','','2022-08-10 11:12:25','2022-08-10 11:12:25','',870,'https://whiskylandmart.com/wp-content/uploads/2022/08/2016-12-22-01.32.04-768x768-2-300x300-1.jpg',0,'attachment','image/jpeg',0),(872,1,'2022-08-10 11:12:57','2022-08-10 11:12:57','This bottle was released for the year 2017 wherein the celebration of Japan Porcelain 400th Birth Anniversary takes place. There were only 150 of these bottles produced, and theyre not easy to find. .It is a tribute to the tradition of the Japanese ancestors to keep the beauty of Japan Artistry forever. The flowery illustration in the ceramic decanter means graceful and delicate. Handmade Arita Ceramic decanter delicately crafted by a famous japanese artist.','Hibiki 35 year old Arita Kutani 2017 ceramic decanter bottle','','publish','open','closed','','hibiki-35-year-old-arita-kutani-2017-ceramic-decanter-bottle','','','2022-08-10 11:14:16','2022-08-10 11:14:16','',0,'https://whiskylandmart.com/?post_type=product&#038;p=872',0,'product','',0),(873,1,'2022-08-10 11:14:10','2022-08-10 11:14:10','','WhatsApp-Image-2021-09-24-at-11.18.30-300x300','','inherit','open','closed','','whatsapp-image-2021-09-24-at-11-18-30-300x300','','','2022-08-10 11:14:10','2022-08-10 11:14:10','',872,'https://whiskylandmart.com/wp-content/uploads/2022/08/WhatsApp-Image-2021-09-24-at-11.18.30-300x300-1.jpg',0,'attachment','image/jpeg',0),(874,1,'2022-08-10 11:15:59','2022-08-10 11:15:59','Hibiki, the most famous blended whisky from Japan, in its 35 year old version hasnt been bottled for several years, and due to the shortage of old and very old Japanese whiskies everybody feared to ever see again one day a bottle of this ultra premium whisky.\r\n\r\nAs well as the previous versions, but also to honor and mark the 400th anniversary of the appearance of porcelain in Japan, Suntory has used the expertise of traditional ceramics producers in Arita and Kutani on the island of Kyushu.\r\n\r\nFor the occasion, the craftsmen have created a traditional design which incorporates the typical shape of Hibiki blend bottles that combines drawings of peonies flowers, symbol of happiness and wealth, with butterflies which represent longevity.\r\n\r\nBottled unchillfiltered at 47% above volume, Hibiki 35 year old is a real blending jewel containing single malts and grain whiskies aged in different types of barrels such as Sherry, Bourbon and Mizunara casks the rare oak from Japan, whose ages range from 35 to 54 year old for the oldest one !\r\n\r\nOnly 150 bottles of each edition were produced.','Hibiki 35 Arita Kutani','Suntory created the surprise by unveiling two ultra limited edition of Hibiki 35 year old called Arita and Kutani which sale is scheduled for November 29, 2016.\r\n\r\n&nbsp;','publish','open','closed','','hibiki-35-arita-kutani','','','2022-08-10 17:35:54','2022-08-10 17:35:54','',0,'https://whiskylandmart.com/?post_type=product&#038;p=874',0,'product','',0),(875,1,'2022-08-10 11:17:07','2022-08-10 11:17:07','','WhatsApp-Image-2021-09-24-at-10.54.25','','inherit','open','closed','','whatsapp-image-2021-09-24-at-10-54-25','','','2022-08-10 11:17:07','2022-08-10 11:17:07','',874,'https://whiskylandmart.com/wp-content/uploads/2022/08/WhatsApp-Image-2021-09-24-at-10.54.25.jpg',0,'attachment','image/jpeg',0),(876,1,'2022-08-10 11:17:38','2022-08-10 11:17:38','Limited Edition 2021\r\n43%, 700ml\r\nFor the Blossom Harmony, the blenders at Suntory married Hibiki liquid with Sakura cask finished whisky, allowing us to explore their fine craftsmanship from a completely new angle.\r\nHibiki Blossom Harmony 2021 released in limited quantities on May 25th 2021.','Hibiki Blossom Harmony','','publish','open','closed','','hibiki-blossom-harmony','','','2022-08-10 11:18:38','2022-08-10 11:18:38','',0,'https://whiskylandmart.com/?post_type=product&#038;p=876',0,'product','',0),(877,1,'2022-08-10 11:18:29','2022-08-10 11:18:29','','WhatsApp-Image-2021-10-14-at-07.57.22','','inherit','open','closed','','whatsapp-image-2021-10-14-at-07-57-22','','','2022-08-10 11:18:29','2022-08-10 11:18:29','',876,'https://whiskylandmart.com/wp-content/uploads/2022/08/WhatsApp-Image-2021-10-14-at-07.57.22.jpg',0,'attachment','image/jpeg',0),(879,1,'2022-08-10 11:19:04','2022-08-10 11:19:04','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n\r\nSuntory is the oldest whisky making company in Japan. Its origins stretch back to a small shop, started in 1899 by Torii Shinjiro, which specialized in selling imported wines. Today, it is the countrys largest and most recognizable producer of quality whisky. Of all its products, the Hibiki remains the most popular, having been chosen as the best whisky in the world on several occasions. This Hibiki 21 Year old 2001 was released for Suntory 100th anniversary and Celebrating new century of 2000. The Hibiki 21 Year Old Century 2001 comes with an attractive presentation box.\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\"></div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Hibiki Century 2001 Limited Edition','<div dir=\"auto\"><strong>Distillery:</strong>Suntory</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n<div dir=\"auto\"><strong>Alcohol Strength:</strong>43%</div>\r\n<div dir=\"auto\"><strong>Bottle Size:</strong>700 Ml</div>\r\n<div dir=\"auto\"><strong>Weight:</strong>2 Kg</div>\r\n&nbsp;','publish','open','closed','','hibiki-century-2001-limited-edition','','','2022-08-10 11:20:38','2022-08-10 11:20:38','',0,'https://whiskylandmart.com/?post_type=product&#038;p=879