','closed','','hibiki-japanese-harmony-30th-anniversary-limited-edition','','','2022-08-10 11:26:19','2022-08-10 11:26:19','',0,'https://whiskylandmart.com/?post_type=product&#038;p=885',0,'product','',0),(886,1,'2022-08-10 11:25:47','2022-08-10 11:25:47','','Hibiki-Japanese-Harmony-30th-Anniversary-Limited-Edition','','inherit','open','closed','','hibiki-japanese-harmony-30th-anniversary-limited-edition','','','2022-08-10 11:25:47','2022-08-10 11:25:47','',885,'https://whiskylandmart.com/wp-content/uploads/2022/08/Hibiki-Japanese-Harmony-30th-Anniversary-Limited-Edition.jpg',0,'attachment','image/jpeg',0),(887,1,'2022-08-10 11:26:22','2022-08-10 11:26:22','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n\r\nThe Hibiki 35 Year Old is, in short, a work of an art. Not only is it the oldest Hibiki you will ever come across, it is also presented in a specially made porcelain bottle made by one of the masters of porcelain making, Tokuda Yasokichi III, from porcelain coming from Arita in Saga Prefecture.\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">In total only 150 bottles were made, presented in a wooden case, this is a bottle made for collectors of rare world class whisky.</div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Hibiki ceramic-35 year old-Tokuda Yasokichi III','<div dir=\"auto\">\r\n<div dir=\"auto\"><strong>Distillery:</strong>Suntory</div>\r\n<div dir=\"auto\"><strong>Age (Years):</strong>35</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n<div dir=\"auto\"><strong>Alcohol Strength:</strong>43%</div>\r\n<div dir=\"auto\"><strong>Bottle Size:</strong>70c</div>\r\n</div>','publish','open','closed','','hibiki-ceramic-35-year-old-tokuda-yasokichi-iii','','','2022-08-10 17:35:54','2022-08-10 17:35:54','',0,'https://