he prestigious Six Pillars odyssey  an exclusive series of limited edition decanters by The Macallan and master French crystal maker Lalique.\r\n\r\nHoused in a one and only, bespoke natural ebony cabinet created by Lalique Maison, The Legacy Collection also holds six Macallan Fine and Rare miniatures and six pairs of Lalique Macallan glasses.\r\n\r\nSince its inception in 2005, The Macallan in Lalique Six Pillars series has captured the imagination of collectors around the world. In 2014, The Macallan accounted for the top ten priced bottles sold at auction; eight out of ten sales being decanters from The Macallan in Lalique series. In 2015, The Macallan was the most valuable whisky brand at auction, accounting for over 25% of the total value traded at auction.\r\n\r\nThe extraordinary Macallan in Lalique Legacy Collection  a set of six stunning crystal decanters containing the rarest of The Macallans single malts aged from 50 to 65 years old.','publish','open','closed','','the-macallan-in-lalique-lagacy-collection','','','2022-08-10 17:35:53','2022-08-10 17:35:53','',0,'https://whiskylandmart.com/?post_type=product&#038;p=982',0,'product','',0),(983,1,'2022-08-10 15:42:19','2022-08-10 15:42:19','','LeClos_Macallan_615x657-1','','inherit','open','closed','','leclos_macallan_615x657-1','','','2022-08-10 15:42:19','2022-08-10 15:42:19','',982,'https://whiskylandmart.com/wp-content/uploads/2022/08/LeClos_Macallan_615x657-1.jpg',0,'attachment','image/jpeg',0),(985,1,'2022-08-10 15:49:21','2022-08-10 15:49:21','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n\r\nA rare and exceptional single cask from The Macallan. This is a 67 years old Macallan, distilled in 1950 and matured in first fill sherry American Sherry butt, it is bottled at a cask strength of 53.4% after all those years