 barrels were used for maturating red wines.</div>\r\n<div dir=\"auto\">another single malt aged 20 years in port wine casks made out of European oak ; these barrels were previously used for maturing port wines.</div>\r\n<div dir=\"auto\">a young single malt aged in bourbon barrels made out of American white oak.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Composition of 3 Single Malts:</div>\r\n<div dir=\"auto\">Aged 20 Years in Sherry</div>\r\n<div dir=\"auto\">Aged 20 Years in port wine cask</div>\r\n<div dir=\"auto\">Aged in young white oak</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Suntory Yamazaki 2014 Limited Edition','<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\"><strong>Alcohol Strength:</strong>43%</div>\r\n<div dir=\"auto\"><strong>Bottle Size:</strong>70cl</div>\r\n<div dir=\"auto\"><strong>Distillery:</strong>Suntory</div>\r\n<div dir=\"auto\"><strong>Weight:</strong>2 Kg</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n</div>\r\n</div>','publish','open','closed','','suntory-yamazaki-2014-limited-edition','','','2022-08-10 17:05:04','2022-08-10 17:05:04','',0,'https://whiskylandmart.com/?post_type=product&#038;p=1025',0,'product','',0),(1026,1,'2022-08-10 17:04:55','2022-08-10 17:04:55','','suntory-yamazaki-limited-edition-2014-p90-11330_image-1','','inherit','open','closed','','suntory-yamazaki-limited-edition-2014-p90-11330_image-1','','','2022-08-10 17:04:55','2022-08-10 17:04:55','',1025,'https://whiskylandmart.com/wp-content/uploads/2022/08/suntory-yamazaki-limited-edition-2014-p90-11330_image-1.jpg',0,'attachment','image/jpeg',0),(1027,1,'2022-08-10 17:05:21','2022-08-10 17:05:21','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n<div 