:16:39','2022-08-10 17:16:39','',1043,'https://whiskylandmart.com/wp-content/uploads/2022/08/Suntory-Yamazaki-35-Year-Old-1263x1600-2.jpg',0,'attachment','image/jpeg',0),(1045,1,'2022-08-10 17:17:13','2022-08-10 17:17:13','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n<div dir=\"auto\">Here, we present the Yamazaki 50 Year Old 2011 Release  one of the oldest, rarest bottlings in the world. This can be defined as a single malt whisky, but also as a real piece of Japanese history. It is the culmination of more than half a century of maturation in oak; one can only imagine the depth of flavour found within. Presented in an oak, handcrafted box, the Yamazaki 50 year-old is more than a whisky. It is a piece of art, and only 150 pieces (bottles) were ever released!</div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Yamazaki 50 Year Old 3rd Edition 2011 Release','<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\"><strong>Distillery:</strong>Yamazaki</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n<div dir=\"auto\"><strong>Single Malt:</strong>Yes</div>\r\n<div dir=\"auto\"><strong>Alcohol Strength:</strong>57%</div>\r\n<div dir=\"auto\"><strong>Bottle Size:</strong>70cl</div>\r\n<div dir=\"auto\"><strong>Label Condition:</strong>Good</div>\r\n<div dir=\"auto\"><strong>Shoulder Level:</strong>Good</div>\r\n<div dir=\"auto\"><strong>Weight:</strong>3 Kg</div>\r\n</div>\r\n</div>','publish','open','closed','','yamazaki-50-year-old-3rd-edition-2011-release','','','2022-08-10 17:35:53','2022-08-10 17:35:53','',0,'https://whiskylandmart.com/?post_type=product&#038;p=1045',0,'product','',0),(1046,1,'2022-08-10 17:17:58','2022-08-10 17:17:58','','Yamazaki-50-1263x1600-1-1','','inherit','open','closed','','yamazaki-50-1263x1600-1-1','','','2022-08-10 17:17:58','2022-08-10 17:17:58','',1045,'https://whiskylandmart.com/wp-content/uploads/2022/08/Yamazaki-50-1263x1600-1-1.jpg',0,'attachment','image/jpeg',0),(1047,1,'2022-08-10 17:18:27','2022-08-10 17:18:27','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n<div dir=\"auto\">\r\n\r\nThe bottle which recently broke the world record for the highest amount paid at auction for a bottle of Japanese Single Malt Whisky, when it sold for $343,000 at Bonhams in August but as global collectors we have the best prices in the market. After more than a half century of aging, a mere 150 bottles of this expression are released each year. As the number of collectors seeking these high end bottles continues to grow, they have become increasingly scarce. Among the few that have had the pleasure of tasting this prolific Japanese Whisky, it is described as a once in a lifetime experience, which offers complex flavors that cannot be compared to anything else.\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Presented in a special wooden box, this Yamazaki 50 Year Old is exceptional. Owning a bottle will instantly move any collection into the ranks of the worlds most elite.</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Yamazaki 50 Years Old  1st Edition 2005','<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\"><strong>Distillery:</strong>Yamazaki</div>\r\n<div dir=\"auto\"><strong>Age:</strong>50 Years</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n<div dir=\"auto\"><strong>Single Malt:</strong>Yes</div>\r\n<div dir=\"auto\"><strong>Alcohol Strength:</strong>53%</div>\r\n<div dir=\"auto\"><strong>Bottle Size:</strong>70cl</div>\r\n<div dir=\"auto\"><strong>Weight:</strong>3 Kg</div>\r\n</div>\r\n</div>','publish','open','closed','','yamazaki-50-years-old-1st-edition-2005','','','2022-08-10 17:35:53','2022-08-10 17:35:53','',0,'https://whiskylandmart.com/?post_type=product&#038;p=1047',0,'product','',0),(1048,1,'2022-08-10 17:19:15','2022-08-10 17:19:15','','Yamazaki-50-Year-Old-2005-Release-A-1-1263x1600-2','','inherit','open','closed','','yamazaki-50-year-old-2005-release-a-1-1263x1600-2','','','2022-08-10 17:19:15','2022-08-10 17:19:15','',1047,'https://whiskylandmart.com/wp-content/uploads/2022/08/Yamazaki-50-Year-Old-2005-Release-A-1-1263x1600-2.jpg',0,'attachment','image/jpeg',0),(1049,1,'2022-08-10 17:20:07','2022-08-10 17:20:07','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n<div dir=\"auto\">\r\n\r\nSuntory whisky has received so many awards and accolades for its whiskies, we actually lost count a long time ago. Of all of Suntorys products, the Yamazaki expressions are somewhat legendary, straight from Japans oldest distillery.\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Here, we present the Yamazaki 50 Year Old 2007 Release  one of the oldest, rarest bottlings in the world. This can be defined as a single malt whisky, but also as a real piece of Japanese history. It is the culmination of more than half a century of maturation in oak; one can only imagine the depth of flavour found within. Presented in an oak, handcrafted box, the Yamazaki 50 year-old is more than a whisky. It is a piece of art.</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Yamazaki 50 Years Old  2nd Edition 2007','<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\">Distillery: Yamazaki</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n<div dir=\"auto\"><strong>Single Malt:</strong>Yes</div>\r\n<div dir=\"auto\"><strong>Alcohol Strength:</strong>53%</div>\r\n<div dir=\"auto\"><strong>Bottle Size:</strong>70cl</div>\r\n<div dir=\"auto\"><strong>Weight:</strong>2 Kg</div>\r\n</div>\r\n</div>','publish','open','closed','','yamazaki-50-years-old-2nd-edition-2007','','','2022-08-10 17:35:53','2022-08-10 17:35:53','',0,'https://whiskylandmart.com/?post_type=product&#038;p=1049',0,'product','',0),(1050,1,'2022-08-10 17:20:59','2022-08-10 17:20:59','','Yamazaki-50-1263x1600-3','','inherit','open','closed','','yamazaki-50-1263x1600-3','','','2022-08-10 17:20:59','2022-08-10 17:20:59','',1049,'https://whiskylandmart.com/wp-content/uploads/2022/08/Yamazaki-50-1263x1600-3.jpg',0,'attachment','image/jpeg',0),(1051,1,'2022-08-10 17:24:23','2022-08-10 17:24:23','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n<div dir=\"auto\">\r\n\r\nPresented in a special wooden box, this Yamazaki 55 Year Old whisky is exceptional. Owning a bottle will instantly move any collection into the ranks of the worlds most elite.\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Introducing The Worlds Oldest Yamazaki Release</div>\r\n<div dir=\"auto\">In early 2020 Suntory announced that it would be releasing a whisky fit for the history books, a Yamazaki Single Malt that had been aged for more than 55 years. The whisky captures the craftsmanship of more than a half century of distilling expertise, combining three iconic casks to create an expression that is second to none.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Combining Three Generations Of Distilling Expertise</div>\r\n<div dir=\"auto\">The first cask was distilled in 1960 by Yamazkis founder, Shinjiro Torii, and carefully aged in mizunara oak. The second and third casks were distilled in 1961 and 1964 by Suntorys second master blender Keizo Saji, then aged in American white oak. The three casks were selected and blended by chief blender Shinji Fukuyo in concert with Shinjiro Torris grandson, the third-generation master blender Shingo Torii.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Throughout the process of blending Yamazaki 55, I used as inspiration the passage of time and wabi-sabithe Japanese belief that imperfections can help to ultimately contribute to perfection, Fukuyo said in a press release. While I often view other extra aged whiskies as art, I consider Yamazaki 55 to be more like a Buddhist statue: calm and mysterious, requiring time to truly enjoy inner beauty.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Whisky Unlike Any Other</div>\r\n<div dir=\"auto\">The Yamazaki 55 Year Old is so special that Suntory has said a normal tasting glass isnt good enough, but that a Burgundy glass be used instead in order to take in the full array of notes that this complex whisky has to offer. It takes an exceptional level of skill to work with well aged whisky in order to retain the distinguishing notes while minimizing any overbearing flavors that can overpower the palate. With this release the Suntory team demonstrates their unparalleled expertise by bringing forth a plethora of notes that are unlike any other whisky that has ever been produced.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">With this expression, you get hints of fresh-cut grass in addition to more tropical flavors such as nearly-ripe mangoes, orange zest, ginger chewsall blanketed by the influence of the mizunara, which imparts subtle notes of bitter citrus rinds, sandalwood, cedar shavings, and a tinge of sweetness thats enhanced by the whiskys mildly saccharine and lasting finish.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Intricate &amp; Beautiful Design</div>\r\n<div dir=\"auto\">The Yamazaki 55 Year Old features an impeccable design that is inspired by Japanese art and culture, bringing forth a level of meticulous detail that is a true masterpiece. The bottles were produced with engraved calligraphy that made use of intricate sandblasting techniques, while incorporating genuine gold dust and real lacquer. The result is an elegant presentation piece that perfectly complements the liquid contained within and will truly stand apart among even the most prized collections.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Includes Miniature Bottle</div>\r\n<div dir=\"auto\">Note that this is the Japan release which includes an exclusive miniature bottle along with the full size bottle. This makes this particular expression among the most rare Yamazaki releases of all time.</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Yamazaki 55 Year Old','<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\"><strong>Distillery:</strong>Yamazaki</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n<div dir=\"auto\"><strong>Single Malt:</strong>Yes</div>\r\n<div dir=\"auto\"><strong>Alcohol Strength:</strong>46%</div>\r\n<div dir=\"auto\"><strong>Bottle Size:</strong>70cl</div>\r\n<div dir=\"auto\"><strong>Box:</strong>Yes</div>\r\n<div dir=\"auto\"><strong>Weight:</strong>2 Kg</div>\r\n</div>\r\n</div>\r\n</div>','publish','open','closed','','yamazaki-55-year-old','','','2022-08-10 17:35:53','2022-08-10 17:35:53','',0,'https://whiskylandmart.com/?post_type=product&#038;p=1051',0,'product','',0),(1052,1,'2022-08-10 17:25:44','2022-08-10 17:25:44','','5037511-005_0-1-1','','inherit','open','closed','','5037511-005_0-1-1','','','2022-08-10 17:25:44','2022-08-10 17:25:44','',1051,'https://whiskylandmart.com/wp-content/uploads/2022/08/5037511-005_0-1-1.jpg',0,'attachment','image/jpeg',0),(1053,1,'2022-08-10 17:26:24','2022-08-10 17:26:24','<div class=\"woocommerce-tabs wc-tabs-wrapper\">\r\n<div id=\"tab-description\" class=\"woocommerce-Tabs-panel woocommerce-Tabs-panel--description panel entry-content wc-tab\" role=\"tabpanel\" aria-labelledby=\"tab-title-description\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\">Every year since 2014, Suntory has released a limited edition version of its award winning Yamazaki whisky. Blended by the companys master blender Shinji Fukuyo, the limited editions are intended to show off what Suntory can do. Already collectors items, these bottles are sure to become rare as time passes.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">We at dekant thought it was only fitting to give our customers a chance to get not just one, but the entire collection of Yamazaki limited edition bottles, 2014, 2015 and the 2016 version. This is as good as things can get!</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">The Yamazaki Limited Edition 2014 was released for duty-free purchase only. It is a limited edition of the award-winning Japanese single malt and earned Gold at the 2007 International Spirits Challenge, along with a Double Gold at the 2005 San Francisco World Spirits Competition. A safe buy if ever there was one.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">The Yamazaki Limited Edition 2015 is, if anything, even better than the 2014, with sweet, smooth, and complex flavours. This is a must try for all fans of quality whisky.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\">Finally, we have the Yamazaki Limited Edition 2016  yet another masterpiece! Bottled at 43% ABV, the 2016 edition is a blend of young single malts, matured in American oak casks, Bourbon barrels, European oak barrels, Sherry and Port Wine casks. Some of it has been aged for over 20 years.</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"related products\"></section>','Yamazaki Limited Edition Full Set 2014-2017','<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\"><strong>Distillery:</strong>Suntory</div>\r\n<div dir=\"auto\"><strong>Whisky Origin:</strong>Japanese</div>\r\n<div dir=\"auto\"><strong>Weight:</strong>6 Kg</div>\r\n</div>\r\n</div>\r\n</div>','publish','open','closed','','yamazaki-limited-edition-full-set-2014-2017','','','2022-08-10 17:27:48','2022-08-10 17:27:48','',0,'https://whiskylandmart.com/?post_type=product&#038;p=1053',0,'product','',0),(1054,1,'2022-08-10 17:27:33','2022-08-10 17:27:33','','whisky-yamazaki-limited-edition-set__25812.1604993758-1','','inherit','open','closed','','whisky-yamazaki-limited-edition-set__25812-1604993758-1','','','2022-08-10 17:27:33','2022-08-10 17:27:33','',1053,'https://whiskylandmart.com/wp-content/uploads/2022/08/whisky-yamazaki-limited-edition-set__25812.1604993758-1.jpg',0,'attachment','image/jpeg',0),(1055,1,'2022-08-10 17:28:36','2022-08-10 17:28:36','','Yamazaki Spanish Oak Cask 2020 Edition','<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<div dir=\"auto\">\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<td class=\"desc\">Distillery</td>\r\n<td>Yamazaki</td>\r\n</tr>\r\n<tr>\r\n<td class=\"desc\">Whisky Origin</td>\r\n<td>Japan</td>\r\n</tr>\r\n<tr>\r\n<td class=\"desc\">Region</td>\r\n<td>Japan</td>\r\n</tr>\r\n<tr>\r\n<td class=\"desc\">ABV</td>\r\n<td>48%</td>\r\n</tr>\r\n<tr>\r\n<td class=\"desc\">Bottle Size</td>\r\n<td>70cl</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>','publish','open','closed','','yamazaki-spanish-oak-cask-2020-edition','','','2022-08-10 17:32:27','2022-08-10 17:32:27','',0,'https://whiskylandmart.com/?post_type=product&#038;p=1055',0,'product','',0),(1056,1,'2022-08-10 17:32:19','2022-08-10 17:32:19','','Yamazaki-Spanish-Oak-Cask-2020-Edition','','inherit','open','closed','','yamazaki-spanish-oak-cask-2020-edition','','','2022-08-10 17:32:19','2022-08-10 17:32:19','',1055,'https://whiskylandmart.com/wp-content/uploads/2022/08/Yamazaki-Spanish-Oak-Cask-2020-Edition.jpg',0,'attachment','image/jpeg',0),(1059,1,'2022-08-10 18:05:36','2022-08-10 18:05:36','','distillery_mobile_thumbnail','','inherit','open','closed','','distillery_mobile_th