INSERT INTO `wp_wc_admin_notes` VALUES (1,'wc-refund-returns-page','info','en_US','Setup a Refund and Returns Policy page to boost your store\'s credibility.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.','{}','unactioned','woocommerce-core','2022-05-27 02:07:40',NULL,0,'plain','',1,0,'info'),(2,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','{}','unactioned','woocommerce-admin','2022-05-27 02:07:41',NULL,0,'plain','',1,0,'info'),(3,'wc-admin-navigation-nudge','info','en_US','You now have access to the WooCommerce navigation','Were introducing a new navigation for a more intuitive and improved user experience. You can enable the beta version of the new experience in the Advanced Settings. Enable it now for your store.','{}','unactioned','woocommerce-admin','2022-05-27 02:07:45',NULL,0,'plain','',1,0,'info'),(4,'wc-admin-complete-store-details','info','en_US','Add your store details to complete store setup','Complete your store details with important information for setup such as your stores base address','{}','unactioned','woocommerce-admin','2022-05-27 02:07:45',NULL,0,'plain','',1,0,'info'),(5,'new_in_app_marketplace_2021','info','en_US','Customize your store with extensions','Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.','{}','unactioned','woocommerce.com','2022-05-27 02:07:47',NULL,0,'plain','',1,0,'info'),(6,'wayflyer_bnpl_q4_2021','marketing','en_US','Grow your business with funding through Wayflyer','Fast, flexible financing to boost cash flow and help your business grow  one fee, no interest rates, penalties, equity, or personal guarantees. Based on your stores performance, Wayflyer provides funding and analytical insights to invest in your business.','{}','pending','woocommerce.com','2022-05-27 02:07:47',NULL,0,'plain','',0,0,'info'),(7,'wc_shipping_mobile_app_usps_q4_2021','marketing','en_US','Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!','{}','pending','woocommerce.com','2022-05-27 02:07:47',NULL,0,'plain','',0,0,'info'),(8,'wc_shipping_mobile_app_q4_2021','marketing','en_US','Print and manage your shipping labels with the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!','{}','pending','woocommerce.com','2022-05-27 02:07:48',NULL,0,'plain','',0,0,'info'),(9,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. Were happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','{}','pending','woocommerce.com','2022-05-27 02:07:49',NULL,0,'plain','',0,0,'info'),(10,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2022-05-27 02:07:49',NULL,0,'plain','',0,0,'info'),(11,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while they\'re shopping on your online store. No more follow-up email requestscustomers get what they want, before they\'re done checking out. Learn more about this extension that comes included in your plan.','{}','pending','woocommerce.com','2022-05-27 02:07:49',NULL,0,'plain','',0,0,'info'),(12,'wc-admin-getting-started-in-ecommerce','info','en_US','Getting Started in eCommerce - webinar','We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','{}','pending','woocommerce.com','2022-05-27 02:07:50',NULL,0,'plain','',0,0,'info'),(13,'your-first-product','info','en_US','Your first product','Thats huge! Youre well on your way to building a successful online store  now its time to think about how youll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','{}','pending','woocommerce.com','2022-05-27 02:07:50',NULL,0,'plain','',0,0,'info'),(14,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','Its crucial to get your stores checkout as smooth as possible to avoid losing sales. Lets take a look at how you can optimize the checkout experience for your shoppers.','{}','unactioned','woocommerce.com','2022-05-31 13:11:58',NULL,0,'plain','',1,0,'info'),(15,'wc-admin-first-five-things-to-customize','info','en_US','The first 5 things to customize in your store','Deciding what to start with first is tricky. To help you properly prioritize, weve put together this short list of the first few things you should customize in WooCommerce.','{}','unactioned','woocommerce.com','2022-05-29 02:07:45',NULL,0,'plain','',1,0,'info'),(16,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','{}','pending','woocommerce.com','2022-05-27 02:07:51',NULL,0,'plain','',0,0,'info'),(17,'share-your-feedback-on-paypal','info','en_US','Share your feedback on PayPal','Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.','{}','pending','woocommerce.com','2022-05-27 02:07:51',NULL,0,'plain','',0,0,'info'),(18,'google_listings_and_ads_install','marketing','en_US','Drive traffic and sales with Google','Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','{}','unactioned','woocommerce.com','2022-09-05 02:11:51',NULL,0,'plain','',0,0,'info'),(19,'wc-subscriptions-security-update-3-0-15','info','en_US','WooCommerce Subscriptions security update!','We recently released an important security update to WooCommerce Subscriptions. To ensure your sites data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help  just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.','{}','pending','woocommerce.com','2022-05-27 02:07:52',NULL,0,'plain','',0,0,'info'),(20,'woocommerce-core-update-5-4-0','info','en_US','Update to WooCommerce 5.4.1 now','WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','{}','pending','woocommerce.com','2022-05-27 02:07:52',NULL,0,'plain','',0,0,'info'),(21,'wcpay-promo-2020-11','marketing','en_US','wcpay-promo-2020-11','wcpay-promo-2020-11','{}','pending','woocommerce.com','2022-05-27 02:07:53',NULL,0,'plain','',0,0,'info'),(22,'wcpay-promo-2020-12','marketing','en_US','wcpay-promo-2020-12','wcpay-promo-2020-12','{}','pending','woocommerce.com','2022-05-27 02:07:53',NULL,0,'plain','',0,0,'info'),(23,'ppxo-pps-upgrade-paypal-payments-1','info','en_US','Get the latest PayPal extension for WooCommerce','Heads up! Theres a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.','{}','pending','woocommerce.com','2022-05-27 02:07:53',NULL,0,'plain','',0,0,'info'),(24,'ppxo-pps-upgrade-paypal-payments-2','info','en_US','Upgrade your PayPal experience!','Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.','{}','pending','woocommerce.com','2022-05-27 02:07:54',NULL,0,'plain','',0,0,'info'),(25,'woocommerce-core-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-27 02:07:55',NULL,0,'plain','',0,0,'info'),(26,'woocommerce-blocks-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-27 02:07:57',NULL,0,'plain','',0,0,'info'),(27,'woocommerce-core-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-27 02:07:59',NULL,0,'plain','',0,0,'info'),(28,'woocommerce-blocks-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-27 02:08:00',NULL,0,'plain','',0,0,'info'),(29,'habit-moment-survey','marketing','en_US','Were all ears! Share your experience so far with WooCommerce','Wed love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.','{}','pending','woocommerce.com','2022-05-27 02:08:01',NULL,0,'plain','',0,0,'info'),(30,'ecomm-wc-navigation-survey','info','en_US','Wed like your feedback on the WooCommerce navigation','Were making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.','{}','pending','woocommerce.com','2022-05-27 02:08:01',NULL,0,'plain','',0,0,'info'),(31,'woocommerce-core-paypal-march-2022-updated','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). Its recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.','{}','pending','woocommerce.com','2022-05-27 02:08:02',NULL,0,'plain','',0,0,'info'),(32,'woocommerce-core-paypal-march-2022-updated-nopp','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).','{}','pending','woocommerce.com','2022-05-27 02:08:02',NULL,0,'plain','',0,0,'info'),(33,'pinterest_03_2022_update','marketing','en_US','Your Pinterest for WooCommerce plugin is out of date!','Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on update now under Pinterest for WooCommerce.','{}','pending','woocommerce.com','2022-05-27 02:08:04',NULL,0,'plain','',0,0,'info'),(34,'setup_task_initiative_survey_q2_2022','survey','en_US','We want to know what matters most to you','Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.','{}','unactioned','woocommerce.com','2022-05-27 02:08:09',NULL,0,'plain','',1,0,'info'),(35,'affirm_q2_2022','marketing','en_US','Boost your business with flexible payments','Expand your customer base with smarter payment options for more shoppers. With Affirm,  you can offer the most relevant payment options at every price point  from four interest-free payments every two weeks to longer installments up to 36 months. Fast-track your revenue goals today!','{}','unactioned','woocommerce.com','2022-05-27 02:08:11',NULL,0,'plain','',1,0,'info'),(36,'setup_task_second_survey_q2_2022','survey','en_US','We want to know what matters most to you','Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.','{}','pending','woocommerce.com','2022-05-27 02:08:13',NULL,0,'plain','',0,0,'info'),(37,'store_setup_survey_survey_q2_2022','survey','en_US','How is your store setup going?','Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWed love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.','{}','pending','woocommerce.com','2022-05-27 02:08:15',NULL,0,'plain','',0,0,'info'),(38,'wc-admin-EU-consumer-protection','marketing','en_US','Important changes to EU consumer protection laws','New regulations to help modernize and strengthen consumer protection laws in the European Union (EU) take effect on May 28, 2022. These rules impact all merchants selling to the EU, regardless of where their business is located. Further detailed information is available on the European Commission\'s official website.','{}','unactioned','woocommerce.com','2022-05-27 02:08:17',NULL,0,'plain','',1,0,'info'),(39,'wc_ipp_order_creation_GTM_launch_q2_2022','marketing','en_US','Grow your business on the go with WooCommerce In-Person Payments','Quickly create new orders, manage transactions, and take secure payments no matter where your business takes you. With automatic inventory sync, WooCommerce In-Person Payments is the only fully integrated solution for taking your WooCommerce store offline.','{}','unactioned','woocommerce.com','2022-05-27 02:08:19',NULL,0,'plain','',1,0,'info'),(40,'wc-admin-launch-checklist','info','en_US','Ready to launch your store?','To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.','{}','unactioned','woocommerce-admin','2022-05-28 02:07:45',NULL,0,'plain','',1,0,'info'),(41,'wc-admin-choosing-a-theme','marketing','en_US','Choosing a theme?','Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.','{}','unactioned','woocommerce-admin','2022-05-28 02:07:46',NULL,0,'plain','',1,0,'info'),(42,'wc-admin-insight-first-product-and-payment','survey','en_US','Insight','More than 80% of new merchants add the first product and have at least one payment method set up during the first week.<br><br>Do you find this type of insight useful?','{}','actioned','woocommerce-admin','2022-05-28 02:07:46',NULL,0,'plain','',1,1,'info'),(43,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.','{}','unactioned','woocommerce-admin','2022-05-29 02:07:39',NULL,0,'plain','',1,0,'info'),(44,'wc-admin-customizing-product-catalog','info','en_US','How to customize your product catalog','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.','{}','unactioned','woocommerce-admin','2022-05-31 13:11:53',NULL,0,'plain','',1,0,'info'),(45,'wc-admin-onboarding-payments-reminder','info','en_US','Start accepting payments on your store!','Take payments with the provider thats right for you - choose from 100+ payment gateways for WooCommerce.','{}','unactioned','woocommerce-admin','2022-06-01 17:23:18',NULL,0,'plain','',1,0,'info'),(46,'wc-admin-woocommerce-payments','marketing','en_US','Try the new way to get paid','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooCommerce Payments</strong>.<br><br>By clicking \"Get started\", you agree to our <a href=\"https://wordpress.com/tos/\" target=\"_blank\">Terms of Service</a>','{}','unactioned','woocommerce-admin','2022-06-09 13:12:30',NULL,0,'plain','',1,0,'info'),(47,'wc-admin-insight-first-sale','survey','en_US','Did you know?','A WooCommerce powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?','{}','unactioned','woocommerce-admin','2022-06-09 13:12:30',NULL,0,'plain','',1,0,'info'),(49,'wc-admin-wisepad3','marketing','en_US','Take your business on the go in Canada with WooCommerce In-Person Payments','Quickly create new orders, accept payment in person for orders placed online, and automatically sync your inventory  no matter where your business takes you. With WooCommerce In-Person Payments and the WisePad 3 card reader, you can bring the power of your store anywhere.','{}','pending','woocommerce.com','2022-06-16 05:13:01',NULL,0,'plain','',0,0,'info'),(50,'TikTok q2_2022','marketing','en_US','Give your store a stage on the worlds fastest-growing advertising channel','With TikTok for WooCommerce, you can sync your catalog, create videos, and track performance in front of TikToks one billion global users. Try the Smart Video Generator to make ads using your existing product images  no camera needed. Get $200 in ad credit from TikTok after a $20 spend (terms &amp; conditions apply).','{}','unactioned','woocommerce.com','2022-06-22 05:50:01',NULL,0,'plain','',0,0,'info'),(51,'tiktok-webinar-promo-july2022','marketing','en_US','Free webinar: TikTok for WooCommerce','Join WooCommerce and TikTok live on July 14 to learn about ad types, trends, and the best ways to connect with an audience of one billion active users on the worlds fastest-growing social platform. Participants have a chance to score a free month of Vimeo Pro, and two winners will get a $5,000 ad credit and more.','{}','pending','woocommerce.com','2022-07-09 02:36:09',NULL,0,'plain','',0,0,'info'),(52,'klarna_q3_2022','marketing','en_US','Meet Klarna  your ultimate growth partner','Increase conversions by offering secure, flexible payment solutions  including buy now, pay later  all through a one-click checkout experience. Plus, youll tap into a whole new market of the worlds most engaged shoppers.','{}','unactioned','woocommerce.com','2022-08-08 02:25:48',NULL,0,'plain','',0,0,'info'),(53,'mercado_pago_q3_2022','marketing','en_US','Get paid with Mercado Pago Checkout','Give your customers a checkout they can trust with Latin America\'s leading payment processor. Securely accept debit and credit cards, cash, bank transfers, and installment payments  backed by exclusive fraud prevention tools.','{}','pending','woocommerce.com','2022-08-09 02:15:12',NULL,0,'plain','',0,0,'info'),(54,'woocommerce-payments-august-2022-need-to-update','update','en_US','Action required: Please update WooCommerce Payments','An updated secure version of WooCommerce Payments is available  please ensure that youre using the latest patch version. For more information on what action you need to take, please review the article below.','{}','pending','woocommerce.com','2022-08-10 09:29:52',NULL,0,'plain','',0,0,'info'),(55,'woocommerce-payments-august-2022-store-patched','update','en_US','WooCommerce Payments has been automatically updated','Youre now running the latest secure version of WooCommerce Payments. Weve worked with the WordPress Plugins team to deploy a security update to stores running WooCommerce Payments (version 3.9 to 4.5). For further information, please review the article below.','{}','pending','woocommerce.com','2022-08-10 09:29:52',NULL,0,'plain','',0,0,'info'),(56,'wc-admin-coupon-page-moved','update','en_US','Coupon management has moved!','Coupons can now be managed from Marketing &gt; Coupons. Click the button below to remove the legacy WooCommerce &gt; Coupons menu item.','{}','unactioned','woocommerce-admin','2022-08-10 23:56:53',NULL,0,'plain','',0,0,'info'),(57,'wc-admin-new-sales-record','info','en_US','New sales record!','Woohoo, August 10th was your record day for sales! Net sales was $2,750.00 beating the previous record of $1,200.00 set on June 13th.','{\"old_record_date\":\"2022-06-13\",\"old_record_amt\":1200,\"new_record_date\":\"2022-08-10\",\"new_record_amt\":2750}','unactioned','woocommerce-admin','2022-08-11 02:10:06',NULL,0,'plain','',0,0,'info'),(58,'wc-update-db-reminder','update','en_US','WooCommerce database update done','WooCommerce database update complete. Thank you for updating to the latest version!','{}','unactioned','woocommerce-core','2022-08-14 20:56:01',NULL,0,'plain','',0,0,'info'),(59,'mobile_app_order_management_q3_2022','marketing','en_US','Take order management on the go','The WooCommerce Mobile App continues to get better with added order management functionality! Add or remove products, edit fees, or change the shipping options in any existing order  all from within the app.','{}','unactioned','woocommerce.com','2022-08-17 02:07:22',NULL,0,'plain','',0,0,'info'),(60,'wc-admin-real-time-order-alerts','info','en_US','Get real-time order alerts anywhere','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.','{}','unactioned','woocommerce-admin','2022-08-25 02:15:08',NULL,0,'plain','',0,0,'info'),(61,'product_creation_usability_test_3_months','survey','en_US','Have a say in the future of WooCommerce','Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.','{}','pending','woocommerce.com','2022-08-26 02:34:53',NULL,0,'plain','',0,0,'info'),(62,'product_creation_usability_test_6_months','survey','en_US','Try the new product edit form prototype','Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.','{}','unactioned','woocommerce.com','2022-08-30 03:17:34',NULL,0,'plain','',0,0,'info'),(63,'wc-admin-orders-milestone','info','en_US','Congratulations on processing 10 orders!','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.','{}','unactioned','woocommerce-admin','2022-09-02 12:11:00',NULL,0,'plain','',0,0,'info'),(64,'product_creation_usability_test_12_months','survey','en_US','Try the new product edit form prototype','Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.','{}','pending','woocommerce.com','2022-09-07 03:43:00',NULL,0,'plain','',0,0,'info'),(65,'custom_deposit_schedules_inbox','marketing','en_US','Customize your deposit schedule','Receive your funds according to your own business needs with custom deposit schedules from WooCommerce Payments. Youll have the flexibility to deposit funds into your bank account daily, weekly, monthly, or even on-demand  youve done the work, now get paid on your terms.','{}','unactioned','woocommerce.com','2022-09-15 02:11:26',NULL,0,'plain','',0,0,'info'),(66,'googlelistings_signals2022_hasGLA','marketing','en_US','Show off your products with Ads on Google','Youre ready to grow with ads. Google optimizes for performance across your products; you only pay for results. If youre new to Google, you can earn up to $500 in ad credits (T&amp;Cs apply). <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">Contact support</a> if you need guidance with Google Listings &amp; Ads.','{}','pending','woocommerce.com','2022-09-23 02:07:30',NULL,0,'plain','',0,0,'info'),(67,'googlelistings_signals2022_noGLA','marketing','en_US','Show off your products with Ads on Google','Youre ready to grow with ads. Google optimizes for performance across your products; you only pay for results. If youre new to Google, you can earn up to $500 in ad credits (T&amp;Cs apply). <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">Contact support</a> if you need guidance with Google Listings &amp; Ads.','{}','pending','woocommerce.com','2022-09-23 02:07:30',NULL,0,'plain','',0,0,'info'),(68,'pre-black-friday-sale-2022-announcement','marketing','en_US','Surprise! Were offering 40% off everything at WooCommerce.com','Just in time to get your store Black Friday ready. Sale ends 7 October, 2pm UTC.','{}','unactioned','woocommerce.com','2022-10-04 02:13:45',NULL,0,'plain','',0,0,'info'),(69,'shipping_category_q4_2022','marketing','en_US','Save time on shipping','Is your store all set to ship? Save valuable time (and money!) by automating your fulfillment process for the busiest shopping season. Explore our range of trusted shipping partners to get started.','{}','unactioned','woocommerce.com','2022-10-15 23:35:43',NULL,0,'plain','',0,0,'info'),(70,'wc-admin-manage-orders-on-the-go','info','en_US','Manage your orders on the go','Look for orders, customer info, and process refunds in one click with the Woo app.','{}','unactioned','woocommerce-admin','2023-02-07 17:10:40',NULL,0,'plain','',0,0,'info'),(71,'google_listings_ads_custom_attribute_mapping_q4_2022','marketing','en_US','Our latest improvement to the Google Listings & Ads extension: Attribute Mapping','You spoke, we listened. This new feature enables you to easily upload your products, customize your product attributes in one place, and target shoppers with more relevant ads. Extend how far your ad dollars go with each campaign.','{}','pending','woocommerce.com','2023-02-07 17:10:41',NULL,0,'plain','',0,0,'info'),(72,'needs-update-eway-payment-gateway-rin-2022-12-20','update','en_US','Security vulnerability patched in WooCommerce Eway Gateway','In response to a potential vulnerability identified in WooCommerce Eway Gateway versions 3.1.0 to 3.5.0, weve worked to deploy security fixes and have released an updated version.\r\nNo external exploits have been detected, but we recommend you update to your latest supported version 3.1.26, 3.2.3, 3.3.1, 3.4.6, or 3.5.1','{}','pending','woocommerce.com','2023-02-07 17:10:41',NULL,0,'plain','',0,0,'info'),(73,'updated-eway-payment-gateway-rin-2022-12-20','update','en_US','WooCommerce Eway Gateway has been automatically updated','Your store is now running the latest secure version of WooCommerce Eway Gateway. We worked with the WordPress Plugins team to deploy a software update to stores running WooCommerce Eway Gateway (versions 3.1.0 to 3.5.0) in response to a security vulnerability that was discovered.','{}','pending','woocommerce.com','2023-02-07 17:10:41',NULL,0,'plain','',0,0,'info'),(74,'ecomm-wc-navigation-survey-2023','info','en_US','Navigating WooCommerce on WordPress.com','We are improving the WooCommerce navigation on WordPress.com and would love your help to make it better! Please share your experience with us in this 2-minute survey.','{}','pending','woocommerce.com','2023-02-07 17:10:41',NULL,0,'plain','',0,0,'info');
